import coding_indoors from "./images/coding_indoors.jpg";
import TitleSection from "./TitleSection";

export default function About() {
	return (
		<div className="About">
			<TitleSection title="A Bit About Myself" backgroundImage={`url(${coding_indoors})`} textStyle={{ color: "var(--light-2)" }} />
		</div>
	);
}
